import { Menu } from 'antd';
import { PureComponent } from 'react';
import {
    MailOutlined,
    AppstoreOutlined,
    SettingOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;
export default class Sorter extends PureComponent {

    state = {
        current: 'mail',
    };

    handleClick = e => {
        console.log('click ', e);
        this.setState({
            current: e.key,
        });
    };

    render() {
        return (
            <div>
                <h3>Sort By</h3>
                <Menu onClick={this.handleClick} selectedKeys={[this.state.current]} mode="horizontal">
                    <Menu.Item key="mail">
                        <MailOutlined />
          Navigation One
        </Menu.Item>
                    <Menu.Item key="app" disabled>
                        <AppstoreOutlined />
          Navigation Two
        </Menu.Item>
                </Menu>
            </div>
        );
    }
}
